INSERT INTO `products` (`id`, `title`, `desc`, `metakey`, `metadesc`, `price`, `weight`, `category_id`, `home_show`, `new`, `sale`, `price_sale`, `created_at`, `updated_at`) VALUES
(1, 'Serpantine art2', 'Модель Serpantine, выполнена она из самого изысканного материала – кожи питона. Самый настоящий хит. Любые изделия, выполненные из кожи питона сами по себе очень дороги, и эксклюзивны. Приобретая сапоги марки VOLARE Вы получаете экслюзивный товар, сопоставимый по качеству с марками мировых лидеров, и существенно экономите. Размеры: 35-43', '', '', '18460', NULL, 1, 1, 0, NULL, NULL, '2013-10-28 13:28:14', '2013-11-21 21:19:38'),
(2, 'Serpantine art1', 'Модель Serpantine, выполнена она из самого изысканного материала – кожи питона. Самый настоящий хит. Любые изделия, выполненные из кожи питона сами по себе  очень дороги, и эксклюзивны. Приобретая сапоги марки VOLARE Вы получаете экслюзивный товар, сопоставимый по качеству с марками мировых лидеров, и существенно экономите.\r\nРазмеры: 35-43', '', '', '19000', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 13:32:07', '2013-11-21 21:19:02'),
(3, 'La freccia Art 6', 'Модель La freccia  – это легкие и очень удобные сапоги, которые имеют интересный  дизайн, украшенные по всей длине блестящими клепками и стильным ремешком. Эта модель придаст вашему образу rock''n''roll style и вы не останетесь незамеченной ни в городской суете ни на зажигательной вечеринке. Размеры: 34-43', '', '', '10000', NULL, 2, 0, 0, NULL, NULL, '2013-10-28 13:34:20', '2013-11-21 21:17:27'),
(4, 'California art4b', 'Низ модели California выполнен из натуральной кожи, голенище - из джинсовой ткани, усеянной стразами и жемчужными бусинками. Ручная работа итальянского мастера. На пятке - кожаная "визитка" производителя VOLARE.', '', '', '8000', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 13:45:25', '2013-11-11 08:28:28'),
(5, 'California art4a', 'Низ модели California выполнен из натуральной кожи, голенище - из джинсовой ткани, усеянной стразами и жемчужными бусинками. Ручная работа итальянского мастера. На пятке - кожаная "визитка" производителя VOLARE.', '', '', '8000', NULL, 2, 0, 0, NULL, NULL, '2013-10-28 13:51:45', '2013-11-11 14:56:15'),
(6, 'Dakota art5', 'Vagabonda, стильная и модная модель, украшенная массивной  цепью  изготовлена из замша высочайшей выделки, встроенный ортопедический каблук делает эти сапоги очень удобными и комфортными. Эта модель отлично подходит для urban style и для поездок в незабываемые и долгожданные путешествия.  ', '', '', '10000', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 14:05:56', '2013-11-11 14:55:40'),
(7, 'BIANCANEVE ART7a', 'Зимняя коллекция. Низ модели BIANCANEVE  выполнен из натуральной кожи, голенище - из натурального меха, украшенное манжетом из натуральной кожи с металлическими заклепками и цепочкой из страз Swarovski. Ручная работа итальянского мастера. На пятке - кожаная "визитка" производителя VOLARE.', '', '', '8850', NULL, 1, 0, 0, NULL, NULL, '2013-10-28 14:09:15', '2013-11-11 15:02:50'),
(8, 'BIANCANEVE ART7b', 'Натуральная кожа высококачественной выделки, ортопедический каблук', '', '', '8850', NULL, 1, 0, 0, NULL, NULL, '2013-10-28 14:12:21', '2013-11-03 17:32:26'),
(9, 'Biancaneve Art7c', 'Зимняя коллекция. Низ модели BIANCANEVE  выполнен из натуральной кожи, голенище - из натурального меха, украшенное цепочкой из страз Swarovski. Ручная работа итальянского мастера. На пятке - кожаная "визитка" производителя VOLARE.', '', '', '8850', NULL, 1, 1, 0, NULL, NULL, '2013-10-28 14:14:13', '2013-11-11 15:01:02'),
(10, 'BIANCANEVE ART7d', 'Зимняя коллекция. Низ модели BIANCANEVE  выполнен из натуральной кожи, голенище - из натурального меха. Ручная работа итальянского мастера. На пятке - кожаная "визитка" производителя VOLARE.', '', '', '8850', NULL, 1, 0, 0, NULL, NULL, '2013-10-28 14:24:16', '2013-11-11 14:59:09'),
(11, 'Pipistrella art3', 'Модель Pipistrella это легкие и удобные сапоги, которые имеют очень интересный декор по всей высоте, украшенные простроченными прорезями, подчеркивая узор, кожаными вставками с блестящими клепками, ну и конечно ремешком. Размеры: 34-43', '', '', '10000', NULL, 2, 0, 0, NULL, NULL, '2013-10-28 14:26:53', '2013-11-21 21:16:06'),
(12, 'Rockettona art11', 'Модель Rockettona  – это легкие и очень удобные сапоги, которые имеют интересный и дерзкий дизайн, украшенные по всей длине  блестящими клепками и стильным ремешком. Эта модель придаст вашему образу rock''n''roll style и вы не останетесь незамеченной ни в городской суете ни на зажигательной вечеринке. Размеры: 34-43 ', '', '', '9800', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 14:28:59', '2013-11-21 21:15:34'),
(13, 'Spaccacuori art9 black', 'Модель Spaccacuori это легкие летние сапоги, которые имеют очень интересный декор по всей высоте, украшенные простроченными прорезями, подчеркивая узор, кожаными вставками с блестящими клепками, ну и конечно ремешком. Размеры: 34-43', '', '', '9600', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 14:32:00', '2013-11-21 21:14:58'),
(14, 'Spaccacuori art9 ', 'Модель Spaccacuor  – это легкие летние сапоги, которые имеют очень интересный декор по всей высоте, украшенные простроченными прорезями, подчеркивая узор, кожаными вставками с блестящими клепками, ну и конечно ремешком.\r\n\r\nРазмеры: 34-43', '', '', '9460', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 14:34:09', '2013-11-21 21:02:37'),
(15, 'Stellina', 'Модель  Stellina это легкие и очень удобные сапоги, которые имеют интересный и стильный дизайн, изготовлены из замши высочайшей выделки, украшенные многочисленными заклепками в виде звезд. Эта модель отлично подходит для urban style и для поездок в незабываемые и долгожданные путешествия. Размеры: 34-43', '', '', '10000', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 14:35:53', '2013-11-21 21:02:00'),
(16, 'Texana art', 'Модель Texana это легкие и очень удобные сапоги, которые имеют интересный и стильный дизайн, выполнены из кожи и замша высочайшей выделки, украшенные узором в виде флоренцианской лилии. Эта модель отлично подходит для urban style и для поездок в незабываемые и долгожданные путешествия. \r\nРазмеры: 34-43', '', '', '10000', NULL, 2, 0, 0, NULL, NULL, '2013-10-28 14:36:58', '2013-11-21 20:58:55'),
(17, 'Urbana art10', 'Модель Urban это легкие и очень удобные сапоги, изготовлены из кожи высочайшей выделки, украшенные орнаментам из многочисленных заклепок. Эта модель отлично подходит для urban style и для поездок в незабываемые и долгожданные путешествия.\r\nРазмеры: 34-43', '', '', '9450', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 14:39:15', '2013-11-21 21:00:27'),
(18, 'Vagabonda art8', ' Vagabonda, стильная и модная модель, изготовлена из кожи высочайшей выделки, присборенные за счет кожаной вставки на задней части  сапога. Все это  придает  оригинальность и неповторимость данной модели, которая отлично подойдет к вашему повседневному стилю.\r\nРазмеры: 34-43', '', '', '9600', NULL, 2, 1, 0, NULL, NULL, '2013-10-28 14:41:08', '2013-11-21 20:59:45'),
(19, 'Браслет из Питона', '', '', '', '3000', NULL, 3, 0, 0, NULL, NULL, '2013-10-31 08:02:36', '2013-10-31 08:12:50'),
(20, 'Ремни из Питона', '', '', '', '4000', NULL, 3, 0, 0, NULL, NULL, '2013-10-31 08:06:07', '2013-10-31 08:06:24'),
(21, 'Hardona art13', 'Модель Hardona  – это легкие и очень удобные сапоги, которые имеют интересный и дерзкий дизайн, украшенные шипами  и блестящими клепками и  стильным ремешком. Эта модель придаст вашему образу rock''n''roll style и вы не останетесь незамеченной ни в городской суете ни на зажигательной вечеринке.\r\nРазмеры: 34-43', '', '', '9000', NULL, 2, 1, 1, NULL, NULL, '2013-10-31 11:15:36', '2013-11-21 20:55:57');
